import InputTodo from "./InputTodo";
import './App.css';
import TodoList from "./TodoList";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        My TODO App
      </header>
      <div>
        <InputTodo />
      </div>
      <div>
        <TodoList />
      </div>
    </div>
  );
}

export default App;
